INSERT INTO `News` (`id`, `news_date`, `information`, `writer`, `severity`) VALUES
(112, '2018-04-16 17:14:31', 'Välkommen till den nya versionen av medlemsregistret. Här kommer jag att skriva om förändringar i medlemsregistret. Har du uppdaterar behörighet kan du skriva här också.', 'Peter Lundin', 0),
(113, '2018-04-16 17:16:12', 'Det var en bugg i sökfunktionen tidigare. Vissa fält skilde på små och stora bokstäver med andra fält inte gjorde det. Nu spelar det ingen roll om du skriver med små eller stora bokstäver i sökfunktionen.', 'Peter Lundin', 0),
(114, '2018-04-16 17:17:36', 'Längst upp till vänster ser du om du har kontakt med databasen för medlemsregistret.', 'Peter Lundin', 0),
(115, '2018-04-16 17:18:55', 'Längst upp till höger ser du vilken behörighetsnivå du har. Det finns &#34;Uppdaterare&#34; och &#34;Läsare&#34;', 'Peter Lundin', 0),
(116, '2018-05-03 18:05:44', 'Nu fungerar det att skriva ut medlemstatistik igen', 'Peter Lundin', 0),
(117, '2018-05-25 16:01:42', 'Nu fungerar det INTE att skriva ut medlemsstatistik igen. Programpaketet som gör graferna har blivit för gammalt och måste bytas. Vill man se vilka som är nya kan man filtrera på nya medlemmar när man tittar på personuppgifter. Jag får se hur och när jag löser detta.....', 'Peter Lundin', 0),
(118, '2018-06-25 19:00:01', 'Nu finns en ny lösning för medlemsstatistik. Den finns under rapporter. Det finns både tabell och grafik', 'Peter Lundin', 0),
(119, '2018-06-25 19:02:13', 'Tidigare har det varit problem att lägga in flera medlemmar i rad om man inte laddat om hela sidan för personinformation. Nu är det fixat!', 'Peter Lundin', 0),
(120, '2018-08-04 17:56:05', 'Jag har uppdaterat kommunikationen med databasen. Den ska nu vara säkrare. ', 'Peter Lundin', 0),
(121, '2018-10-07 14:49:47', 'Funktion för att registrera nyckelinnehav finns. Men vi behöver gå igenom med nyckelansvarig innan det tas i bruk', 'Peter Lundin', 0),
(122, '2018-10-07 14:50:34', 'Sökfunktionen bör nu fungera bättre i mobila enheter, telefoner etc.', 'Peter Lundin', 0),
(123, '2018-10-07 14:55:14', 'Anton:  titta på utfallet när du använder Grupp &#34;Underlag för anonymisering ... &#34;. Hur gör vi med dessa?', 'Peter Lundin', 0),
(124, '2019-02-24 19:37:06', 'Den första anonymiseringen är genomförd. Anton du kan väl kolla i [Om Saron] ->[Hantering av personuppgifter] är det begripligt?', 'Peter Lundin', 0),
(125, '2019-07-17 06:57:17', 'Ny version av registret med förbättrad hjälpfunktion, ny sortering i adresskalendern (om det finns boende på en adress med olika efternamn så kommer dessa att synas på respektive plats i alfabetisk ordning), starkare kryptering av datat.', 'Peter Lundin', 0),
(126, '2019-07-17 07:00:16', 'Titta igenom (Om Saron)(Hantering av personuppgifter). Kan vi följa dessa rutiner?', 'Peter Lundin', 0),
(127, '2019-08-11 13:08:19', 'Hej Björn! Välkommen till medlemsregistret. Kolla gärna runt. Innan du börjar uppdatera är det bra om du läser under menyn Om Saron.  Du är alltid välkommen med frågor. ', 'Peter Lundin', 0),
(128, '2019-09-25 20:26:50', 'Önskemål: Skapa en lista med mobiltelefonnummer till dem som saknar e-postadress, men som har mobiltelefonnummer. Då kan man lättare skicka sms till alla dem samtidigt (kan komplettera församlingsutskick via e-post).  Kolla under rapporter! Kalasbra!', 'Christian Delén', 0),
(129, '2019-09-01 11:42:18', 'Har äntligen lagt till utskriftsunderlag för adressetiketter. Finns under rapporter. Uppdatering av vilka som ska få en etikett utskriven görs under information om hemmet. inte på personen.', 'Peter Lundin', 0),
(130, '2019-09-06 11:22:04', 'Jag har kommit in!', 'Björn Stromvall', 0),
(131, '2019-10-29 16:37:28', 'Välkommen till medlemsregistret Ulf', 'Peter Lundin', 0),
(132, '2020-01-08 18:57:43', 'Jag har fixat adress-dubletterna', 'Peter Lundin', 0),
(133, '2020-03-17 17:06:41', 'En ny version av Saron är upplagd. Det mesta är nytt av det som inte syns. Menyerna är flyttade lite.', 'Peter Lundin', 0),
(134, '2020-09-02 15:14:14', 'Fixat felet att datum ser konstiga ut efter uppdatering.', 'Peter Lundin', 0),
(135, '2020-11-01 19:33:46', 'Ny funktionalitet avseende bemanning av vår organisation. Se meny Organisation', 'Peter Lundin', 0),
(136, '2020-11-13 22:59:07', 'Ny rapport som är underlag till årsberättelse se rapporter', 'Peter Lundin', 0),
(137, '2020-12-10 17:50:27', 'Nu finns för funktion för att lägga till medhjälpare i registret. Lägg till en person utan medlemsuppgifter. Lägg därefter uppdrag på personen. Personen kommer att status medhjälpare så länge den har uppdrag på sig.', 'Peter Lundin', 0),
(138, '2020-12-11 14:09:48', 'Farten i systemet har blivit bättre. De beror på att inloggningsmekanismen bytts ut. Om ni omotiverat skulle bli utkastade maila mig.  ', 'Peter Lundin', 0),
(139, '2020-12-21 11:55:59', 'Jag har fixat en bugg i inloggningen så det borde vara enklare att logg in nu', 'Peter Lundin', 0),
(141, '2021-02-14 12:12:18', 'En ny version av Saron är uppdladdad. Det finns en kortfattad dokumentation under hjälp angående organisationsdelarna', 'Peter Lundin', 0),
(142, '2021-02-16 11:27:57', 'Nu har en aktuell organisationskalender skapats. Se Rapporter. ', 'Peter Lundin', 0),
(143, '2021-05-09 09:33:53', 'Födelsedagslistan är i funktion igen', 'Peter Lundin', 0),
(144, '2021-07-03 20:37:30', 'Ny version av Saron upplagd. &#34;Registeröversikten&#34; hade vissa problem att lista sitt innehåll. Det gick heller inte att spara uppdaterade organisationsenheter. Det ska funka nu!', 'Peter Lundin', 0),
(145, '2021-07-09 09:49:22', 'FIXAT: När man listar &#34;Hem&#34; visas &#34;land&#34; som &#34;stad&#34; och riktiga staden visas inte alls. Det gäller både listan och redigeringsrutan. Redigera med försiktighet.', 'Peter Lundin', 0),
(147, '2022-10-06 21:23:31', 'Dert vart lite efterskalv i medlemsregistret efter hemsidestrasslet. Förstår inte riktigt varför men det är fixat nu.', 'Peter Lundin', 0),
(148, '2022-10-07 06:39:39', 'Födelsedagslistan fungerar inte. Jag får ta mig en titt på detta vid tillfälle', 'Peter Lundin', 0),
(149, '2022-11-14 19:08:34', 'Ny version av Saron. Du kan läsa mer under menyn Om Saron', 'Peter Lundin', 1),
(150, '2022-12-10 17:49:37', 'Längst till höger i de flesta tabeller finns en kolumn som heter Uppdaterad. Den ska innehålla understrukna datum. Om så inte är fallet kan du behöva uppdatera CSS. Det görs enklast genom att du laddar om sidan samtidigt som du håller ner . Om det finns understrukna datum så ska du kunna lägga muspekaren på datumet och få upp en gul ruta med ytterligare information.', 'Peter Lundin', 0),
(151, '2023-02-03 16:46:33', 'En bugg gjorde att vänkontakter som anonymiserat räknades in bland avslutade medlemmar är rättad', 'Peter Lundin', 0),
(152, '2023-02-03 16:47:03', 'Nu går det inte att ändra uppgifter på personer som anonymiserats', 'Peter Lundin', 0),
(153, '2023-02-19 21:33:27', 'Nu är organisationen uppdaterad i enlighet med årsmötets beslut. Beslutad organisation finns under menyn Rapporter', 'Peter Lundin', 0);
